script: |
  super -f text -I q11691.spq | sort > q11691.out

inputs:
  - name: q11691.spq
    data: |
      SELECT ALL + col2 + col2 FROM tab2 (FORMAT parquet) WHERE + col2 * - col1 NOT BETWEEN ( - col0 ) AND - col0 + - col0 * col2;
  - name: tab2

outputs:
  - name: q11691.out
    data: |
      52
      54
      76
